  <>
    <Helmet>
      <title>Customers | Material Kit</title>
    </Helmet>
    <Box sx={{ backgroundColor: 'background.default', minHeight: '100%', py: 3 }}>
      <Container maxWidth={false}>
        <Box sx={{ pt: 3 }}>
        </Box>
      </Container>
    </Box>
  </>
)

export default CustomerList;
